CREATE DATABASE IF NOT EXISTS customer_data;

USE customer_data;

CREATE TABLE IF NOT EXISTS `customer_data` (`customerNumber` int(11) NOT NULL AUTO_INCREMENT,`first_name` varchar(50) NOT NULL,`last_name` varchar(50) NOT NULL,`company_name` varchar(50) NOT NULL,`address` varchar(50) NOT NULL,`city` varchar(50) NOT NULL,`country` varchar(50) NOT NULL,`postal` varchar(15) DEFAULT NULL,`phone1` varchar(15) DEFAULT NULL,`phone2` varchar(15) DEFAULT NULL,`email` varchar(50) NOT NULL,`web` varchar(50) NOT NULL,PRIMARY KEY (`customerNumber`));


